import React, { useEffect, useState } from "react";

const Chapternotes = () => {
  const [results, setResults] = useState("");

  useEffect(() => {
    const fetchBooks = async () => {
      try {
        const response = await fetch(`/codes/${global.values.code}/details`);
        if (response.ok) {
          const data = await response.json();
          setResults(data);
        } else {
          console.error("Failed to fetch data");
        }
      } catch (error) {
        console.error("Error:", error);
      }
    };
    fetchBooks();
  }, [global.values.code]);

  console.log("our result is", results);
  return (
    <div className="chapter">
      <div>
        <table>
          <thead></thead>
          <tbody>
            {results && (
              <tr key={results.code}>
                <td>{results.chapter.description}</td>
              </tr>
            )}
            {results &&
              results.chapter.notes.map((note, index) => (
                <tr key={index} className="chaptertr">
                  <td className="chaptertd">
                    {note.classification}:
                    <td className="chaptertds">{note.notes}</td>
                  </td>
                </tr>
              ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Chapternotes;
